import React from "react";
import "./style.css";

function Home() {
    return(
        <div className="masthead">
            <div className="overlay">
                <div className="container">
                    <div className="row">
                        <div className="col-lg-12 mx-auto">
                            <div className="site-heading">
                                <h2 className="display-4 font-italic text-center col-12 animated fadeInUp delay-1s" style={{fontFamily: "aressence"}}>
                                    Kids teaching kids to lead the way in protecting the world's oceans</h2>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
